let highlightNodeWithDelay = (nodeID) => {
    return new Promise(function (resolve) {
    setTimeout(function () {
    console.log('start highlight node', nodeID);
    cy.$('#' + nodeID).addClass('highlight');
}, 2000);
    resolve('success');
});
};

let highlightEdgeWithDelay = (edgeIDs) => {
    return new Promise((resolve) => {
    setTimeout(function () {
    for(let i = 0; i < edgeIDs.length; i++) {
    setTimeout(function () {
    console.log('start to highlight the edges: ', edgeIDs[i]);
    cy.$('#' + edgeIDs[i]).addClass('highlight');
}, (i + 1) * 2000);
}
}, 2000);
    resolve('highlight edges successful');
});
};

String.prototype.escapeSpecialChars = function() {
    return this.replace(/\\n/g, "\\n")
    .replace(/\\'/g, "\\'")
    .replace(/\\"/g, '\\"')
    .replace(/\\&/g, "\\&")
    .replace(/\\r/g, "\\r")
    .replace(/\\t/g, "\\t")
    .replace(/\\b/g, "\\b")
    .replace(/\\/g, "")
    .replace(/"{/g, "{")
    .replace(/}"/g, "}")
    .replace(/\\f/g, "\\f");
};

String.prototype.escapeSpecialChars2 = function() {
    return this.replace(/\\n/g, "\\n")
    .replace(/\\'/g, "\\'")
    .replace(/\\"/g, '\\"')
    .replace(/\\r/g, "\\r")
    .replace(/\\t/g, "\\t")
    .replace(/\\b/g, "\\b")
    .replace(/\\/g, "")
    .replace(/]"/g, "]")
    .replace(/"\[/g, "[")
    .replace(/\\f/g, "\\f");
};

